import React from 'react';

const ListInformation = () => {
    return (
        <div className="information">
            <h1>List</h1>
            <p>A list is an Abstract Data Type (ADT) that represents data in a linear structure. Elements can be added or removed at any point in the list. The list maintains a specific order depending on where elements were inserted.</p>
            <br />
            <p><u>A list includes the following basic operations:</u></p>
            <ul>
                <li><b>Insert:</b> inserts an element into the list at a specific index</li>
                <li><b>Remove:</b> removes an element from the list at a specific index</li>
                <li><b>Get:</b> returns an element from the list at a specific index without removing it</li>
            </ul>
            <br />
            <p><u>Since a stack is an ADT, it has multiple possible implementations:</u></p>
            <ul>
                <li><b>Array List:</b> </li>
                <li><b>Linked List:</b> </li>
            </ul>
        </div>
    );
}

export default ListInformation;
